import { createSlice } from '@reduxjs/toolkit';

const initialState = {
    stock: {},
}

const stockSlice = createSlice({
    name: 'stockitem',
    initialState,
    reducers: {
        loadstock: (state, action) => {
            state.stock = action.payload
        }
    }
});

export default stockSlice.reducer;
const { loadstock } = stockSlice
